import React from "react";

const ListRender = () => {
  let list = ["Juan", 
  "Lazaro", 
  "Thiago", 
  "Luan", 
  "Pedro"
];
  return (
    <div>
      <h2>Lista de presen√ßa</h2>
      <ul>
        {
            list.map((item) => item.toUpperCase(
            <li>{item}</li>
        ))}
      </ul>
    </div>
  );
};
export default ListRender;
